import './App.css';
import {Button, Card, Col, Container, Jumbotron, Row} from "react-bootstrap";
import AppHeader from "./components/AppHeader";
import AppGrid from "./components/AppGrid";
import React, {useEffect, useState} from "react";
import AppMachineBox from "./components/AppMachineBox";

function App() {
    const [machineList, setMachineList] = useState([])
    useEffect(() => {
        GetMachine()
    }, [])

    function GetMachine() {
        try {
            console.log('Heeloo')
        } catch (e) {
            console.error(e)
        }
    }

    return (
        <>
            <AppHeader/>
            <Container fluid='md'>
                <AppGrid>
                    <AppMachineBox/>
                </AppGrid>
            </Container>
        </>
    );
}

export default App;
